// src/components/Navbar.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const menuItems = [
  { name: 'AAMS', path: '/aams' },
  { name: 'Features', path: '/features' },
  { name: 'Demo', path: '/demo' },
  { name: 'Download', path: '/download' },
  { name: 'Pricing', path: '/pricing' },
  { name: 'Support', path: '/support' },
  { name: 'FAQ', path: '/faq' },
];

const Navbar = ({ isLoggedIn, handleLogin, handleLogout }) => {
  const [dropdown, setDropdown] = useState(null);

  return (
    <nav className="bg-blue-600 text-white px-6 py-4 shadow">
      <ul className="flex space-x-6">
        {menuItems.map((item) => (
          <li
            key={item.name}
            className="relative"
            onMouseEnter={() => setDropdown(item.name)}
            onMouseLeave={() => setDropdown(null)}
          >
            <Link to={item.path} className="hover:underline">
              {item.name}
            </Link>

            {dropdown === item.name && (
              <div className="absolute top-10 left-0 bg-white text-black rounded shadow p-3 z-50">
                {isLoggedIn ? (
                  <button onClick={handleLogout} className="hover:text-red-600">Logout</button>
                ) : (
                  <button onClick={handleLogin} className="hover:text-green-600">Login</button>
                )}
              </div>
            )}
          </li>
        ))}
      </ul>
    </nav>
  );
};

export default Navbar;
